import React from 'react';
import { add, diff, mul, division } from './Add.js';
function App(){
    return(
        <ul>
            <li>Sum of two number is { add(40,3) }</li>
            <li>Difference of two number is { diff(40,2) }</li>
            <li>Multiplication of two number is { mul(31,2) }</li>
            <li>Division of two number is { division(31,2) }</li>
        </ul>
    );
}

export default App;
